import React from "react";
import "./Updates.css";
import { UpdatesData } from "../../Data/Data";

const RecentActivity = () => {
  return (
    <div className="RecentActivity">
      {UpdatesData.map((item, idx) => (
        <div className="activityItem" key={idx}>
          <img src={item.img} alt="user" className="activityImg" />
          <div className="activityContent">
            <div className="activityText">
              <span className="activityName">{item.name}</span>
              <span className="activityMessage">{item.noti}</span>
            </div>
            <span className="activityTime">{item.time}</span>
          </div>
        </div>
      ))}
    </div>
  );
};

export default RecentActivity;
